- input: "TEXT\x1CC00208991\x1CTEXT-00001\x1C\x1CF3XA\x1C-This amendment is in response
    to your letter of April 10, 2013 regarding the Committee's Amended September Monthly
    Report.  You have asked for additional information regarding two disbursements
    described as Fraudulent transactions.  In 2012, an individual whose identity is
    unknown to the Committee created counterfeit checks in the lineness of the Committee's
    checks.  Two of the checks were successfully used to draw funds from the Committee's
    account.  The Committee accurately reported these two disbursements as payments
    to the individuals identified as payees on the cancelled checks.  The incident
    did not result in any misstatements on the Committee's reports, and the Committee
    has worked with its bank to take steps to prevent similar incidents from occurring
    in the future.  -All disbursements that are reported on Schedule H-4 are administrative
    and are not in connection with a Federal candidate or Federal Election Activity.
    \ All payments for salaries, and payroll taxes that are reported as administrative
    are not paid on behalf of employees who spent more than 25% of their compensated
    time on Federal Election Activity.\n"
